body:
This PR introduces `CayennePath` and `CayennePathSegment` classes (that should be value objects, but that's still not a thing in Java). 
It allows to make any path-related logic more transparent and precise.
There are some minor incompatibilities introduced. They are all just changes of the return type in several methods from `String` to `CayennePath` (like `ObjRelationship.getDbRelationshipPath()` method), so shouldn't be a big problem.

Here are some examples of it's usage: 
```java
// 1. concatenate paths
CayennePath key = parentPath == null
                ? path.dot(entity.getName())
                : parentPath.dot(path).dot(entity.getName());

// 2. mark the last path segment as outer join
CayennePathSegment last = getPath().last();
CayennePath outerPath = getPath().parent().dot(last.outer())

// 3. get tail of the path
CayennePath pathRemainder = path.tail(1);
```
